import React from "react";
import axios from "axios";

class AjaxPostExample extends React.Component {
  state = {
    input: [],
  };

  render() {
    return (
      <React.Fragment>
        <h1>AJAX POST EXAMPLE</h1>
        <input id="name1" placeholder="Enter Name :" />
        <br />
        <input id="email" placeholder="Enter Email :" />
        <br />
        <input id="age" placeholder="Enter Age :" />
        <br />
        <input id="quali" placeholder="Enter Qualification :" />
        <br />
        <button id="save_data">Save Data Using Ajax</button>
        <br />
      </React.Fragment>
    );
  }
}

export default AjaxPostExample;
